import { jsx as _jsx } from "react/jsx-runtime";
import classNames from 'classnames';
import { useTheme } from '../../';
import { mergeDeep } from '../../helpers/merge-deep';
export const PaginationButton = ({ active, children, className, onClick, theme: customTheme = {}, ...props }) => {
    const theme = mergeDeep(useTheme().theme.pagination, customTheme);
    return (_jsx("button", { className: classNames({
            [theme.pages.selector.active]: active,
        }, className), onClick: onClick, ...props, children: children }));
};
PaginationButton.displayName = 'Pagination.Button';
export const PaginationNavigation = ({ children, className, onClick, theme: customTheme = {}, disabled = false, ...props }) => {
    const theme = mergeDeep(useTheme().theme.pagination, customTheme);
    return (_jsx("button", { className: classNames({
            [theme.pages.selector.disabled]: disabled,
        }, className), disabled: disabled, onClick: onClick, ...props, children: children }));
};
PaginationNavigation.displayName = 'Pagination.Navigation';
